import{_ as e,o as t,c as a,O as i}from"./chunks/framework.9482e208.js";const p=JSON.parse('{"title":"§ 19.2-242 Accused discharged from jail if not indicted in time.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/19.2-242.md","filePath":"vacode/19.2-242.md"}'),r={name:"vacode/19.2-242.md"},n=i('<h1 id="§-19-2-242-accused-discharged-from-jail-if-not-indicted-in-time" tabindex="-1">§ 19.2-242 Accused discharged from jail if not indicted in time. <a class="header-anchor" href="#§-19-2-242-accused-discharged-from-jail-if-not-indicted-in-time" aria-label="Permalink to &quot;§ 19.2-242 Accused discharged from jail if not indicted in time.&quot;">​</a></h1><p>A person in jail on a criminal charge that has been certified or otherwise transferred from a district court to a circuit court shall be discharged from imprisonment if a presentment, indictment or information be not found or filed against him before the end of the second term of the court at which he is held to answer, unless it appear to the court that material witnesses for the Commonwealth have been enticed or kept away or are prevented from attendance by sickness or inevitable accident, and except, also, in the cases provided in §§ <a href="/vacode/19.2-168.1/">19.2-168.1</a> and <a href="/vacode/19.2-169.1/">19.2-169.1</a>. A discharge under the provisions of this section shall not, however, prevent a reincarceration after a presentment or indictment has been found.</p><p>Code 1950, § 19.1-163; 1960, c. 366; 1975, c. 495; 2018, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?181+ful+CHAP0551" target="_blank" rel="noreferrer">551</a>.</p>',3),o=[n];function c(d,s,h,f,l,m){return t(),a("div",null,o)}const u=e(r,[["render",c]]);export{p as __pageData,u as default};
